import React from "react";
import "./card.css";

const Card = ({ message, callback }) => {
  return (
    <div class="country-card">
      {/* <h2>{country.name.common}</h2> */}
      <img
        className="flag-box"
        src={message}
        alt={country.name.common}
      />
      <p>{country.name.official}</p>
      {/* <p>
        <a href={country.maps.googleMaps} class="subscribe-span" id="subscribe">
          Google Maps
        </a>{" "}
        link
      </p> */}
      {/* Took this button reference from https://getcssscan.com/css-buttons-examples */}
      <button className="button-85" onClick={() => callback("home")}>
        Navigate back to home
      </button>
    </div>
  );
};

export default Card;
